import { IconSkillBox } from "../components/IconSkillBox";
import html from "../images/html-5.png"

export function SkillsBox(){
  
    return (
        <div className="row-span-2 flex flex-col w-full justify-center items-center">
            <span className="color-main text-3xl">SKILLS</span>
            <div className="flex flex-col text-xl">
                <IconSkillBox text="HTML" image={html}/>
                <span className="text-white">HTML,CSS</span>
                <span className="text-white">JavaScript</span>
                <span className="text-white">ReactJS</span>
                <span className="text-white">PHP</span>
                <span className="text-white">Bootstrap</span>
                <span className="text-white">Tailwind</span>
                <span className="text-white">WordPress</span>
            </div>
        </div>
      );
}
